import { useState } from "react";

const Greeting = () => {
  const [chnagedtext, setChangedText] = useState(false);

  const changeTextHandler = () => {
    setChangedText(true);
  };
  return (
    <div>
      <h2>Hello World</h2>
      <p>It's good to see you</p>
      <button onClick={changeTextHandler}></button>
    </div>
  );
};

export default Greeting;
